INSERT INTO `products` VALUES (1,'BTC-WBIPA-3007531','bia-thu-cong-wooden-bridges-ipa','Bia thủ công Wooden Bridges IPA','8250cdb3-6812-4b0b-885d-fe29d77fdd74','Thể tích: 330ml\nABV: 7.5%\nNồng độ: 31%','<p>Lớp bia m&agrave;u v&agrave;ng đồng mang hương thơm hoa bia đặc sắc, IPA Wooden Bridge Cầu Gỗ đặc biệt bởi sự b&ugrave;ng nổ hương vị ban đầu, nhưng mang lại một kết th&uacute;c dịu &ecirc;m đến bất ngờ cho người thưởng thức.</p>',55000,2,1,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:45:32','2023-03-20 09:35:57',NULL),(2,'BHNNX-24L330ML-VT','bia-ha-noi-nhan-xanh-thung-24-lon-330ml-phien-ban-tet','Bia Hà Nội Nhãn Xanh – Thùng 24 lon 330ml – Phiên bản Tết','fc558ba3-e01a-4db1-b0f9-09db1f7d029f','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 4.3 ± 0.4%<br>\n• Thành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\n• HSD: 9 tháng kể từ ngày sản xuất<br><br>\n\n \n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA H&Agrave; NỘI XANH (PHI&Ecirc;N BẢN ĐẶC BIỆT BAO B&Igrave; XU&Acirc;N) &ndash; TH&Ugrave;NG 24 LON 330ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Dung t&iacute;ch: 330ml/lon</p>\n\n<p>&bull; Nồng độ cồn: 4.3 &plusmn; 0.4%</p>\n\n<p>&bull; Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon</p>\n\n<p>&bull; HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Bia H&agrave; Nội (nh&atilde;n xanh): Hương bia truyền thống &ndash; Sức sống miền Trung</strong></p>\n\n<p>Với mong muốn đ&aacute;p ứng tốt hơn nhu cầu của người ti&ecirc;u d&ugrave;ng tr&ecirc;n mọi miền đất nước, bia H&agrave; Nội nh&atilde;n xanh l&agrave; sự kết hợp giữa tinh hoa trong hơn 120 năm của Bia H&agrave; Nội v&agrave; khẩu vị bia đặc trưng của người d&acirc;n nơi miền Trung Tổ quốc. Sản phẩm Bia H&agrave; Nội nh&atilde;n xanh sở hữu chất lượng tuyệt hảo, được đ&uacute;c kết từ những nguy&ecirc;n liệu bia h&agrave;ng đầu.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<p>&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</p>\n\n<p>&bull; Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</p>\n\n<p>&bull; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</p>\n\n<p>&bull; Ngon hơn khi uống lạnh (10-15̊C) &bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>',269000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 08:36:48','2023-03-24 08:48:57',NULL),(3,'SJHIM-V-300-12','ruou-soju-him-vi-vai','Rượu Soju HIM vị vải','0a0a871e-c497-4a53-a42e-311df8359bab','Thể tích: 330ml\nNồng độ: 31%','<p>Xuất xứ: H&agrave;n Quốc Độ cồn: 12% M&ocirc; tả sản phẩm: Rượu Soju HIM vị vải nhập khẩu 100% từ H&agrave;n Quốc, hương thơm từ tr&aacute;i vải tươi m&aacute;t v&agrave; vị ngọt thanh tự nhi&ecirc;n l&ocirc;i cuốn, độ cồn nhẹ dễ uống. C&aacute;ch sử dụng: Ướp lạnh v&agrave; uống trực tiếp</p>',120000,3,5,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:32:03','2023-03-27 04:13:23',NULL),(4,'BHN-24L330ML','bia-ha-noi-thung-24-lon-330ml','Bia Hà Nội – Thùng 24 lon 330ml','7bafe3b0-0093-4c53-a7f7-3a960475f2d0','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 4.6 ± 0.4%<br>\n• Thành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\n• HSD: 12 tháng kể từ ngày sản xuất<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA H&Agrave; NỘI V&Agrave;NG &ndash; TH&Ugrave;NG 24 LON 330ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong><br />\n&bull; Dung t&iacute;ch: 330ml/lon<br />\n&bull; Nồng độ cồn: 4.6 &plusmn; 0.4%<br />\n&bull; Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon<br />\n&bull; HSD: 12 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Bia H&agrave; Nội: G&igrave;n giữ tinh hoa &ndash; N&acirc;ng tầm vị thế</strong><br />\nLần đầu ti&ecirc;n được giới thiệu với người y&ecirc;u bia Việt Nam v&agrave;o năm 1992, chất lượng cũng như h&igrave;nh thức tiện lợi của Bia lon H&agrave; Nội l&agrave; l&yacute; do khiến sản phẩm n&agrave;y lu&ocirc;n được nhắm tới l&agrave;m qu&agrave; tặng v&agrave;o những dịp lễ Tết hay những dịp kỷ niệm quan trọng. Bia lon H&agrave; Nội l&agrave; chất x&uacute;c t&aacute;c quan trọng khiến cho c&acirc;u chuyện những dịp tụ tập th&ecirc;m vui vẻ v&agrave; h&agrave;o hứng.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong><br />\n&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi<br />\n&bull; Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai<br />\n&bull; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe<br />\n&bull; Ngon hơn khi uống lạnh (10-15̊C)<br />\n&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>',275000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 09:14:51','2023-03-24 09:14:51',NULL),(5,'SJHIM-NX-330-12','ruou-soju-him-nho-xanh','Rượu Soju HIM nho xanh','136964c9-7070-4a08-854a-cd14ff52960c','Thể tích: 330ml\nNồng độ: 31%','<p>Xuất xứ: H&agrave;n Quốc Độ cồn: 12% M&ocirc; tả sản phẩm: Rượu Soju HIM vị nho xanh nhập khẩu 100% từ H&agrave;n Quốc, vị ngọt nhẹ, thanh m&aacute;t v&agrave; hương thơm độc đ&aacute;o của nho tươi tự nhi&ecirc;n. C&aacute;ch sử dụng:Ướp lạnh v&agrave; uống trực tiếp</p>',63000,3,5,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:29:00','2023-03-20 09:33:52',NULL),(6,'DKAV-DCVTMG-50G','da-ca-vi-trung-muoi-g-50g','DA CÁ VỊ TRỨNG MUỐI G 50G','38292e73-c9d0-486e-8163-87a76df84661','- Snack Da cá trứng muối G thơm bùi ngọt vị lại giòn tan đảm bảo chinh phục giác quan của bạn ngay từ lần đầu thưởng thức. Vị ngon từ da cá tươi miếng nguyên được xử lý công phu bằng công nghệ chiên chân không hiện đại giúp miếng da không bám dầu, giữ lại tối đa dưỡng chất vốn có của cá (omega 3), kết hợp độc đáo với trứng muối thơm ngọt béo bùi kích thích tối đa vị giác. Không chỉ ngon lành từ nguyên liệu, béo ngọt từ gia vị tinh tế, Da cá trứng muối G còn hấp dẫn bởi bao bì hiện đại, gói nhỏ dễ sử dụng, chỉ cần xé cạnh là bạn có thể thưởng thức ngay món snack thơm lành.','<p><b>DA C&Aacute; VỊ TRỨNG MUỐI G 50G</b></p>\n\n<p><strong>V&igrave; sao n&ecirc;n chọn sản phẩm n&agrave;y</strong></p>\n\n<p>&bull; G l&agrave; một thương hiệu thuộc tập đo&agrave;n GREENFEED, được th&agrave;nh lập năm 2019 với cam kết mang đến những sản phẩm L&agrave;nh, Ngon, Lạ cho kh&aacute;ch h&agrave;ng:</p>\n\n<p>&bull; Nguồn nguy&ecirc;n liệu đầu v&agrave;o từ thịt heo sạch, đảm bảo an to&agrave;n 100%</p>\n\n<p>&bull; Quy tr&igrave;nh sản xuất đạt chuẩn HACCP, ISO 22000:2018</p>\n\n<p>&bull; Ngọt thịt tự nhi&ecirc;n</p>\n\n<p>&bull; Sử dụng nguy&ecirc;n liệu độc đ&aacute;o tạo n&ecirc;n hương vị mới lạ</p>\n\n<p>&bull; Tiện lợi chế biến cho bữa ăn l&agrave;nh ngon.</p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Thương hiệu: G</p>\n\n<p>&bull; Trọng lượng: 50g</p>\n\n<p>&bull; Xuất xứ: Việt Nam</p>\n\n<p>&bull; Th&agrave;nh phần: Da c&aacute;</p>\n\n<p>&bull; Bảo quản: Bảo quản nơi kh&ocirc; r&aacute;o, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp.</p>\n\n<p>&bull; Hướng dẫn sử dụng: Ăn ngay hoặc chế biến th&agrave;nh c&aacute;c m&oacute;n ăn kh&aacute;c</p>\n\n<p>&bull; Gợi &yacute; chế biến m&oacute;n ngon: salad trộn</p>\n\n<p>&bull; Hạn sử dụng: 6 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p>&bull; Sản phẩm nhận được c&oacute; thể kh&aacute;c với h&igrave;nh ảnh về m&agrave;u sắc v&agrave; số lượng nhưng vẫn đảm bảo khối lượng v&agrave; chất lượng.</p>\n\n<p>&bull; Gi&aacute; sản phẩm &aacute;p dụng cho kh&aacute;ch h&agrave;ng mua h&agrave;ng online qua website hoặc app, kh&ocirc;ng &aacute;p dụng tại cửa h&agrave;ng.</p>',36000,8,14,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-27 03:10:12','2023-03-28 07:14:12',NULL),(7,'BHHN-LOC6C-1L','loc-6-chai-bia-hoi-ha-noi-habeco-1-lit-chai','LỐC 6 CHAI BIA HƠI HÀ NỘI – HABECO (1 lít/ chai)','372a99b3-a647-44b4-9b0a-534fd0e44203','SẢN PHẨM CHỈ GIAO NỘI THÀNH HÀ NỘI\n\nThương hiệu: Bia Hơi Hà Nội Xuất xứ: Việt Nam\nNồng độ: 4.0 ± 0.4%\nDung tích: 1 lít\nQuy cách: Lốc 6 chai\nThời gian phục vụ giao hàng\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>LỐC 6 CHAI BIA HƠI H&Agrave; NỘI &ndash; HABECO (1 l&iacute;t/ chai)</strong></p>\n\n<p><strong>SẢN PHẨM CHỈ GIAO H&Agrave; NỘI</strong></p>\n\n<p>Bia Hơi H&agrave; Nội &ndash; một nh&atilde;n hiệu ra đời v&agrave; ph&aacute;t triển c&ugrave;ng những năm th&aacute;ng thăng trầm của Thủ Đ&ocirc; Ng&agrave;n Năm Văn Hiến. Bao g&oacute;i mới được giới thiệu v&agrave;o m&ugrave;a h&egrave; 2020 ph&ugrave; hợp cho lối sống hiện đại v&agrave; năng động. H&atilde;y tận hưởng Bia Hơi H&agrave; Nội tại mọi nơi bạn muốn đến.</p>\n\n<p><strong>1. Th&ocirc;ng tin chi tiết về sản phẩm: Bia Hơi H&agrave; Nội</strong><br />\nThương hiệu: Bia Hơi H&agrave; Nội<br />\nXuất xứ: Việt Nam<br />\nNồng độ: 4.0 &plusmn; 0.4%<br />\nDung t&iacute;ch: 1 l&iacute;t<br />\nQuy c&aacute;ch: Lốc 6 chai</p>\n\n<p><strong>2. Hướng dẫn sử dụng:</strong><br />\nBia uống được trực tiếp hoặc đổ ra ly. Ngon hơn khi uống lạnh, tốt nhất ở 3-8̊C<br />\nHSD: 30 ng&agrave;y kể từ ng&agrave;y sản xuất<br />\nBảo quản: Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (nhiệt độ &lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>\n\n<p>&ndash; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi &ndash; Kh&ocirc;ng d&agrave;nh cho phụ nữ mang thai.<br />\n&ndash; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe.</p>',169000,4,17,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-29 08:32:31','2023-03-29 08:32:31',NULL),(8,'GBN-SPRP24L-300','sapporo-premium-24-lon-330ml','Sapporo Premium 24 lon 330ml','cdfc1256-c09b-4b4b-92e5-f6e44c26dad1','Sapporo Premium 24 lon 330ml','<p><strong>Th&ugrave;ng bia Sapporo - 24 lon 330ml</strong>&nbsp;&aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>&nbsp;</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn 