hời gian bảo quản. Nhà máy sản xuất bia hiện đại và quy trình sản xuất khép kín tiên tiến đều được đặt tại Việt Nam.</p>\r\n\r\n<p><br />\r\nMới đây, Sapporo cũng đã cho ra mắt thiết kế bao bì mới và nâng cấp hương vị bia với một tinh thần luôn sẵn sàng đồng hành cùng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng hình ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong dòng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt sánh mịn, 7 phần bia sáng trong. Hình ảnh bia tươi với lớp bọt căng đầy mang đến cảm giác ngon miệng, sảng khoái, gợi lên vị êm đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Xuất Xứ: Việt Nam</p>\r\n\r\n<p>Dung Tích: 330ml</p>\r\n\r\n<p>Hạn Sử Dụng: 12 Tháng</p>',1170000,5,9,'active',1,0,NULL,'2023-03-16 09:31:15','2023-04-04 10:20:04',NULL),(18,'HRK-PACK6-330-43','ruou-mo-nhat-ban-haruka-set-6','Rượu mơ Nhật Bản Haruka set 6','78401abb-a87b-40dd-b785-a0d5daf3556d','Thể tích: 330ml\nNồng độ: 43%','<p>Gi&aacute; ni&ecirc;m yết: 360.000đ&nbsp;</p>\n\n<p>Dung t&iacute;ch: 180ml&nbsp;</p>\n\n<p>Nồng độ cồn: 14%&nbsp;</p>\n\n<p>Quy c&aacute;ch: 4 set/th&ugrave;ng Xuất xứ: Việt Nam&nbsp;</p>\n\n<p>*C&aacute;ch sử dụng:</p>\n\n<p>&nbsp;Ngon nhất khi uống lạnh, uống chung với đ&aacute; hoặc pha chế cocktail. Uống ấm v&agrave;o m&ugrave;a đ&ocirc;ng gi&uacute;p tăng hương vị đậm đ&agrave;, ph&ograve;ng c&aacute;c bệnh h&ocirc; hấp, đường ruột, giải tỏa stress. L&agrave;m đẹp da v&agrave; hỗ trợ giảm c&acirc;n hiệu quả.&nbsp;</p>\n\n<p>*M&ocirc; tả sản phẩm: Haruka từ mơ tươi Nhật Bản, đường ph&egrave;n tinh khiết v&agrave; rượu sochu. Vị nhẹ nh&agrave;ng chua ngọt dễ uống, hương thơm tươi m&aacute;t tự nhi&ecirc;n, Haruka l&agrave; sản phẩm đặc biệt ph&ugrave; hợp cho những buổi d&atilde; ngoại, những bữa li&ecirc;n hoan th&ecirc;m phần th&uacute; vị. Với bao b&igrave; bắt mắt c&ugrave;ng t&aacute;c dụng nổi bật tốt cho sức khỏe, Haruka c&ograve;n th&iacute;ch hợp để l&agrave;m qu&agrave; tặng &yacute; nghĩa d&agrave;nh tặng cho những người th&acirc;n y&ecirc;u trong những dịp đặc biệt. *Đ&aacute;nh gi&aacute; kh&aacute;ch h&agrave;ng.</p>',360000,10,13,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:22:25','2023-03-29 04:26:43',NULL),(19,'SJHIM-D-300-12','ruou-soju-him-dao','Rượu Soju HIM đào','5b5495fe-1498-493c-9a8b-5b4ec118f0bd','Thể tích: 330ml\nNồng độ: 31%','<p>Xuất xứ: H&agrave;n Quốc Độ cồn: 12% M&ocirc; tả sản phẩm: Rượu Soju HIM vị đ&agrave;o nhập khẩu 100% từ H&agrave;n Quốc, l&agrave; sự kết hợp độc đ&aacute;o của rượu soju với vị đ&agrave;o thơm m&aacute;t, vị ngọt nhẹ k&iacute;ch th&iacute;ch vị gi&aacute;c tuyệt vời. C&aacute;ch sử dụng: Ướp lạnh v&agrave; uống trực tiếp</p>',63000,3,5,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:30:40','2023-03-20 09:33:14',NULL),(20,'GBN-BBT-10L','hcm-bom-bia-tuoi-10l','HCM - Bom bia tươi 10L','bc59c393-2ca4-4ae2-b47e-f0ea031d059c','HCM - Bom bia tươi 10L','<p><strong>Bia tươi Sapporo Premium loại 10L</strong>&nbsp;được sản xuất theo quy tr&igrave;nh 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p>Bia tươi Sapporo Premium mang đến hương vị bia cao cấp với độ cồn 5.0%, sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. D&ograve;ng sản phẩm bia tươi Sapporo Premium được phục vụ với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong, mang lại những khoảnh khắc &ecirc;m đằm sảng kho&aacute;i. Tận hưởng bia tươi Sapporo Premium với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của Sapporo.</p>',836000,4,2,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:30:26','2023-04-04 10:07:43','2023-04-04 10:07:43'),(21,'BHP-24L330ML','bia-hanoi-premium-thung-24-lon-330ml','Bia Hanoi Premium – Thùng 24 lon 330ml','ddb0a862-114b-4c7f-8e4b-9f80d1b94eab','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 4.9 ± 0.4%<br>\n• Thành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\n• HSD: 9 tháng kể từ ngày sản xuất<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA H&Agrave; NỘI PREMIUM LON CAO &ndash; TH&Ugrave;NG 24 LON 330ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<ul>\n	<li>Dung t&iacute;ch: 330ml/lon</li>\n	<li>Nồng độ cồn: 4.9 &plusmn; 0.4%</li>\n	<li>Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon</li>\n	<li>HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</li>\n</ul>\n\n<p><strong>Bia H&agrave; Nội Premium: G&igrave;n giữ tinh hoa &ndash; N&acirc;ng tầm vị thế</strong></p>\n\n<p>B&iacute; quyết để tạo ra d&ograve;ng bia thơm ngon của Hanoi Beer Premium nằm ở phương ph&aacute;p l&ecirc;n men chuyển h&oacute;a tới độ, kết hợp với sinh lực tr&agrave;n đầy của d&ograve;ng men trẻ nhằm để lại dư vị thuần khiết, m&ugrave;i hương thơm m&aacute;t quyến rũ từ những nụ hoa houblon từ Cộng h&ograve;a S&eacute;c thơ mộng. &ldquo;C&aacute;c bạn đ&atilde; s&aacute;ng tạo tới mức kh&ocirc;ng ngờ&rdquo; &ndash; Tiến sỹ Bill Simpson, chuy&ecirc;n gia nếm bia h&agrave;ng đầu thế giới đ&atilde; nhận x&eacute;t.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u.</li>\n</ul>',349000,4,4,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 09:41:32','2023-03-24 09:41:32',NULL),(22,'HRK-820-14','ruou-mo-nhat-ban-haruka-chai-lon','Rượu mơ Nhật Bản Haruka chai lớn','0cec27ea-8119-4298-863e-067fcbd18ede','Thể tích: 180ml\nNồng độ: 14%','<p>Quy c&aacute;ch: 12 chai/th&ugrave;ng&nbsp;</p>\n\n<p>Xuất xứ: Việt Nam&nbsp;</p>\n\n<p>C&aacute;ch sử dụng: Ngon nhất khi uống lạnh, uống chung với đ&aacute; hoặc pha chế cocktail. Uống ấm v&agrave;o m&ugrave;a đ&ocirc;ng gi&uacute;p tăng hương vị đậm đ&agrave;, ph&ograve;ng c&aacute;c bệnh h&ocirc; hấp, đường ruột, giải tỏa stress. L&agrave;m đẹp da v&agrave; hỗ trợ giảm c&acirc;n hiệu quả.&nbsp;</p>\n\n<p>M&ocirc; tả sản phẩm: Haruka từ mơ tươi Nhật Bản, đường ph&egrave;n tinh khiết v&agrave; rượu sochu. Vị nhẹ nh&agrave;ng chua ngọt dễ uống, hương thơm tươi m&aacute;t tự nhi&ecirc;n, Haruka l&agrave; sản phẩm đặc biệt ph&ugrave; hợp cho những buổi d&atilde; ngoại, những bữa li&ecirc;n hoan th&ecirc;m phần th&uacute; vị. Với bao b&igrave; bắt mắt c&ugrave;ng t&aacute;c dụng nổi bật tốt cho sức khỏe, Haruka c&ograve;n th&iacute;ch hợp để l&agrave;m qu&agrave; tặng &yacute; nghĩa d&agrave;nh tặng cho những người th&acirc;n y&ecirc;u trong những dịp đặc biệt.</p>',250000,10,13,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:19:47','2023-03-20 09:31:23',NULL),(23,'GBN-SPRP12L-500','sapporo-premium-12-lon-500ml','Sapporo Premium 12 lon 500ml','103ca60b-e40f-4b43-a11d-e6ecb5264398','Sapporo Premium 12 lon 500ml','<p><strong>Th&ugrave;ng bia Sapporo Premium - 12 lon 500ml</strong>&nbsp;&aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>&nbsp;</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Dung T&iacute;ch: 500ml</p>\n\n<p>Hạn Sử Dụng: 12 Th&aacute;ng</p>',315000,4,9,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:15:37','2023-04-04 10:20:04',NULL),(24,'BHHN-24L-500ML-PBT','bia-hoi-ha-noi-thung-24-lon-500ml-phien-ban-tet','Bia Hơi Hà Nội – Thùng 24 lon 500ml – Phiên bản Tết','db9a9d73-919d-402f-8768-da5564942a1e','Thông tin sản phẩm\n• Dung tích: 500ml/lon\n• Nồng độ cồn: 4.1 ± 0.4%\n• Thành phần: nước, malt, gạo, đường, hoa Houblon\n• HSD: 5 tháng kể từ ngày sản xuất\n\nThời gian phục vụ giao hàng\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA HƠI H&Agrave; NỘI (PHI&Ecirc;N BẢN ĐẶC BIỆT BAO B&Igrave; XU&Acirc;N) &ndash; TH&Ugrave;NG 24 LON 500ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Dung t&iacute;ch: 500ml/lon</p>\n\n<p>&bull; Nồng độ cồn: 4.1 &plusmn; 0.4%</p>\n\n<p>&bull; Th&agrave;nh phần: nước, malt, gạo, đường, hoa Houblon</p>\n\n<p>&bull; HSD: 5 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Bia Hơi H&agrave; Nội: Một n&eacute;t văn ho&aacute; H&agrave; Nội</strong></p>\n\n<p>Bia Hơi H&agrave; Nội ra đời v&agrave; ph&aacute;t triển c&ugrave;ng những năm th&aacute;ng thăng trầm của Thủ Đ&ocirc; Ng&agrave;n Năm Văn Hiến. Đổi thay qua từng ng&agrave;y, những sản phẩm mới của Bia Hơi H&agrave; Nội đ&atilde; được ra mắt v&agrave; phổ cập tr&ecirc;n thị trường để n&eacute;t văn ho&aacute; n&agrave;y ng&agrave;y c&agrave;ng đẹp hơn, c&agrave;ng gần gũi với tất cả c&aacute;c thế hệ.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<p>&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</p>\n\n<p>&bull; Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</p>\n\n<p>&bull; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</p>\n\n<p>&bull; Ngon hơn khi uống lạnh (10-15̊C)</p>\n\n<p>&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>',409000,4,17,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-29 08:28:30','2023-03-29 08:28:30',NULL),(25,'DKAV-KHVBTG-25G','kho-heo-vi-bo-toi-g-25g','KHÔ HEO VỊ BƠ TỎI G 25G','efc4d6e4-b2c3-4349-9c7b-0ff80cf2ad9b',NULL,'<p><b>KH&Ocirc; HEO VỊ BƠ TỎI G 25G</b></p>\n\n<p><strong>V&igrave; sao n&ecirc;n chọn sản phẩm n&agrave;y</strong></p>\n\n<p>&bull; G l&agrave; một thương hiệu thuộc tập đo&agrave;n GREENFEED, được th&agrave;nh lập năm 2019 với cam kết mang đến những sản phẩm L&agrave;nh, Ngon, Lạ cho kh&aacute;ch h&agrave;ng:</p>\n\n<p>&bull; Nguồn nguy&ecirc;n liệu đầu v&agrave;o từ thịt heo sạch, đảm bảo an to&agrave;n 100%</p>\n\n<p>&bull; Quy tr&igrave;nh sản xuất đạt chuẩn HACCP, ISO 22000:2018</p>\n\n<p>&bull; Ngọt thịt tự nhi&ecirc;n</p>\n\n<p>&bull; Sử dụng nguy&ecirc;n liệu độc đ&aacute;o tạo n&ecirc;n hương vị mới lạ</p>\n\n<p>&bull; Tiện lợi chế biến cho bữa ăn l&agrave;nh ngon.</p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Thương hiệu: G</p>\n\n<p>&bull; Trọng lượng: 25g</p>\n\n<p>&bull; Xuất xứ: Việt Nam</p>\n\n<p>&bull; Th&agrave;nh phần: Thịt heo</p>\n\n<p>&bull; Bảo quản: Bảo quản nơi kh&ocirc; r&aacute;o, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp.</p>\n\n<p>&bull; Hướng dẫn sử dụng: Ăn ngay hoặc chế biến th&agrave;nh c&aacute;c m&oacute;n ăn kh&aacute;c.</p>\n\n<p>&bull; Gợi &yacute; chế biến m&oacute;n ngon: gỏi kh&ocirc; heo, salad trộn</p>\n\n<p>&bull; Hạn sử dụng: 6 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p>&bull; Sản phẩm nhận được c&oacute; thể kh&aacute;c với h&igrave;nh ảnh về m&agrave;u sắc v&agrave; số lượng nhưng vẫn đảm bảo khối lượng v&agrave; chất lượng.</p>\n\n<p>&bull; Gi&aacute; sản phẩm &aacute;p dụng cho kh&aacute;ch h&agrave;ng mua h&agrave;ng online qua website hoặc app, kh&ocirc;ng &aacute;p dụng tại cửa h&agrave;ng.</p>',15000,8,14,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-27 03:39:31','2023-03-28 07:10:47',NULL),(26,'BHN-24L330ML-VT','bia-ha-noi-thung-24-lon-330ml-phien-ban-tet-1','Bia Hà Nội – Thùng 24 lon 330ml – Phiên bản Tết','d0f0bbd0-545c-4725-99a5-17e04332db2b','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 4.6 ± 0.4%<br>\n• Thành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\n• HSD: 12 tháng kể từ ngày sản xuất<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA H&Agrave; NỘI V&Agrave;NG (PHI&Ecirc;N BẢN ĐẶC BIỆT BAO B&Igrave; XU&Acirc;N) &ndash; TH&Ugrave;NG 24 LON 330ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong><br />\n&bull; Dung t&iacute;ch: 330ml/lon<br />\n&bull; Nồng độ cồn: 4.6 &plusmn; 0.4%<br />\n&bull; Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon<br />\n&bull; HSD: 12 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Bia H&agrave; Nội: G&igrave;n giữ tinh hoa &ndash; N&acirc;ng tầm vị thế</strong><br />\nLần đầu ti&ecirc;n được giới thiệu với người y&ecirc;u bia Việt Nam v&agrave;o năm 1992, chất lượng cũng như h&igrave;nh thức tiện lợi của Bia lon H&agrave; Nội l&agrave; l&yacute; do khiến sản phẩm n&agrave;y lu&ocirc;n được nhắm tới l&agrave;m qu&agrave; tặng v&agrave;o những dịp lễ Tết hay những dịp kỷ niệm quan trọng. Bia lon H&agrave; Nội l&agrave; chất x&uacute;c t&aacute;c quan trọng khiến cho c&acirc;u chuyện những dịp tụ tập th&ecirc;m vui vẻ v&agrave; h&agrave;o hứng.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong><br />\n&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi<br />\n&bull; Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai<br />\n&bull; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe<br />\n&bull; Ngon hơn khi uống lạnh (10-15̊C)<br />\n&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>',275000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 08:47:31','2023-03-24 09:06:10',NULL),(27,'GBN-COMBO-ED','combo-em-dam','Combo Êm Đằm','3e04bbfb-4abd-4aca-a8cc-fbc5767a3ca8','Combo Êm Đằm','<p><strong>Th&ugrave;ng bia Sapporo - 24 lon 330ml</strong>&nbsp;&aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Dung T&iacute;ch: 330ml</p>\n\n<p>Hạn Sử Dụng: 12 Th&aacute;ng</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Snack Da c&aacute; trứng muối G</strong>&nbsp;thơm b&ugrave;i ngọt vị lại gi&ograve;n tan đảm bảo chinh phục gi&aacute;c quan của bạn ngay từ lần đầu thưởng thức. Vị ngon từ da c&aacute; tươi miếng nguy&ecirc;n được xử l&yacute; c&ocirc;ng phu bằng c&ocirc;ng nghệ chi&ecirc;n ch&acirc;n kh&ocirc;ng hiện đại gi&uacute;p miếng da kh&ocirc;ng b&aacute;m dầu, giữ lại tối đa dưỡng chất vốn c&oacute; của c&aacute; (omega 3), kết hợp độc đ&aacute;o với trứng muối thơm ngọt b&eacute;o b&ugrave;i k&iacute;ch th&iacute;ch tối đa vị gi&aacute;c. Kh&ocirc;ng chỉ ngon l&agrave;nh từ nguy&ecirc;n liệu, b&eacute;o ngọt từ gia vị tinh tế, Da c&aacute; trứng muối G c&ograve;n hấp dẫn bởi bao b&igrave; hiện đại, g&oacute;i nhỏ dễ sử dụng, chỉ cần x&eacute; cạnh l&agrave; bạn c&oacute; thể thưởng thức ngay m&oacute;n snack thơm l&agrave;nh.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Khối lượng: 50g</p>\n\n<p>Hạn Sử Dụng: 6 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p>Sản phẩm của : C&ocirc;ng ty TNHH Feddy</p>',830000,4,2,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:24:51','2023-04-04 10:07:43','2023-04-04 10:07:43'),(28,'BTB-24L330ML','bia-truc-bach-thung-24-lon-330ml','Bia Trúc Bạch – Thùng 24 lon 330ml','2cf2303b-f9f5-4003-9942-6267b9373176','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 5.1 ± 0.4%<br>\n•Thành phần: nước, malt, gạo, đường, hoa Houblon<br>\n• HSD: 9 tháng kể từ ngày sản xuất<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA TR&Uacute;C BẠCH</strong><strong>&nbsp;LON CAO</strong><strong>&nbsp;&ndash; TH&Ugrave;NG 24 LON 330ML</strong></p>\n\n<p>Th&ocirc;ng tin sản phẩm:</p>\n\n<ul>\n	<li>Dung t&iacute;ch: 330ml/lon</li>\n	<li>Nồng độ cồn: 5.1 &plusmn; 0.4%</li>\n	<li>Th&agrave;nh phần: nước, malt, gạo, đường, hoa Houblon</li>\n	<li>HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</li>\n</ul>\n\n<p><strong>Bia Tr&uacute;c Bạch: Kiệt t&aacute;c chinh phục đỉnh cao</strong></p>\n\n<p>Tr&uacute;c Bạch l&agrave; loại bia nội đầu ti&ecirc;n của Việt Nam khi sản phẩm n&agrave;y ra đời v&agrave;o năm 1958. D&ograve;ng bia cao cấp được kết tinh từ hoa bia Saaz &ndash; một trong bốn loại hoa bia qu&yacute; tộc của thế giới được trồng duy nhất tại thung lũng Zatec v&agrave; l&uacute;a mạch vụ xu&acirc;n thu hoạch từ những v&ugrave;ng nguy&ecirc;n liệu nổi tiếng của Ph&aacute;p v&agrave; Cộng h&ograve;a S&eacute;c. D&ograve;ng bia m&agrave;u v&agrave;ng &oacute;ng v&agrave; trong suốt như mật ong. Khi r&oacute;t, bọt bia trắng, d&agrave;y, xốp. Đặc biệt, khi uống, bia c&oacute; vị đắng nhẹ, vị đắng n&agrave;y từ từ chuyển sang vị ngọt dịu của mạch nha thượng hạng. Vị bia độc đ&aacute;o n&agrave;y l&agrave; kết quả của qu&aacute; tr&igrave;nh l&ecirc;n men tự nhi&ecirc;n d&agrave;i ng&agrave;y, l&acirc;u gấp 2 &ndash; 3 lần so với c&aacute;c loại bia th&ocirc;ng thường.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u.</li>\n</ul>',455000,4,10,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 10:34:21','2023-03-24 10:34:21',NULL),(29,'UNIAQUA-24C-500ML','nuoc-uong-dong-chai-uniaqua-thung-24-chai-500ml','Nước uống đóng chai Uniaqua – Thùng 24 chai 500ml','b5ecb0ca-0bc8-484a-8fc4-ad0df0148be9','Thông tin sản phẩm\n• Dung tích: 500ml/chai\n• Thành phần: nước được khai thác từ nguồn nước ngầm tự nhiên\n• HSD: 2 năm kể từ ngày sản xuất\n• Bảo quản nơi khô ráo, sạch sẽ, thoáng mát, tránh ánh nắng trực tiếp\n\nThời gian phục vụ giao hàng\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>NƯỚC UỐNG Đ&Oacute;NG CHAI UNIAQUA &ndash; TH&Ugrave;NG 24 CHAI 500ML</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong><br />\n&bull; Dung t&iacute;ch: 500ml/chai<br />\n&bull; Th&agrave;nh phần: nước được khai th&aacute;c từ nguồn nước ngầm tự nhi&ecirc;n<br />\n&bull; HSD: 2 năm kể từ ng&agrave;y sản xuất<br />\n&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp</p>\n\n<p><strong>HABECO &ndash; Thương hiệu đồ uống h&agrave;ng đầu Việt Nam</strong><br />\nNhững d&ograve;ng sản phẩm nổi tiếng l&agrave;m n&ecirc;n thương hiệu HABECO c&oacute; thể kể đến như Bia hơi H&agrave; Nội, Bia lon H&agrave; Nội, Bia Tr&uacute;c Bạch, Hanoi Beer Premium&hellip; Với b&iacute; quyết c&ocirc;ng nghệ &ndash; truyền thống gần 130 năm, hệ thống thiết bị hiện đại, đội ngũ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n l&agrave;nh nghề, c&aacute;c sản phẩm của HABECO đ&atilde; trở th&agrave;nh niềm tự h&agrave;o của thương hiệu Việt v&agrave; được ph&acirc;n phối rộng r&atilde;i tới c&aacute;c thị trường nước ngo&agrave;i như Đ&agrave;i Loan, H&agrave;n Quốc, Anh, Đức, Mỹ,&hellip;</p>\n\n<p><strong>Nước uống đ&oacute;ng chai UniAqua: Thật sảng kho&aacute;i</strong><br />\nBắt nguồn từ mạch nước ngầm tự nhi&ecirc;n, UniAqua tiếp tục trải qua qu&aacute; tr&igrave;nh sản xuất được &aacute;p dụng nhữn