rc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Dung T&iacute;ch: 330ml</p>\n\n<p>Hạn Sử Dụng: 12 Th&aacute;ng</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Kh&ocirc; g&agrave; vị l&aacute; chanh G</strong>&nbsp;được l&agrave;m từ 100% thịt g&agrave; tươi sạch, sản xuất bằng c&ocirc;ng nghệ hiện đại đảm bảo vệ sinh an to&agrave;n. Sợi kh&ocirc; g&agrave; v&agrave;ng n&acirc;u &oacute;ng ả, khi ăn vị ngọt tự nhi&ecirc;n từ thịt g&agrave; quyện với ớt cay cay v&agrave; l&aacute; chanh thơm nức k&iacute;ch th&iacute;ch vị gi&aacute;c. Sản phẩm đ&oacute;ng hũ nhựa nắp nh&ocirc;m 2 lớp kh&oacute;a bảo vệ, nhỏ gọn, tiện lợi khi d&ugrave;ng bữa trưa nhanh tại c&ocirc;ng ty, đem đi du lịch, nh&acirc;m nhi khi xem một bộ phim hoặc c&oacute; mặt tr&ecirc;n b&agrave;n nhậu.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Trọng Lượng: 180g</p>\n\n<p>Hạn Sử Dụng: 6 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p>Sản phẩm của : C&ocirc;ng ty TNHH Feddy</p>',455000,4,2,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:28:25','2023-04-04 10:07:43','2023-04-04 10:07:43'),(40,'BHNP-24L330ML-PBT','bia-hanoi-premium-thung-24-lon-330ml-phien-ban-tet','Bia Hanoi Premium – Thùng 24 lon 330ml – Phiên bản Tết','de5dbc8f-6ae1-4924-aa52-11a5f004fa50','Thời gian phục vụ giao hàng<br><br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>Bia Hanoi Premium &ndash; Th&ugrave;ng 24 lon 330ml &ndash; Phi&ecirc;n bản Tết&nbsp;</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<ul>\n	<li>Dung t&iacute;ch: 330ml/lon</li>\n	<li>Nồng độ cồn: 4.9 &plusmn; 0.4%</li>\n	<li>Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon</li>\n	<li>HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</li>\n</ul>\n\n<p><strong>HABECO &ndash; Thương hiệu đồ uống h&agrave;ng đầu Việt Nam</strong></p>\n\n<p>Những d&ograve;ng sản phẩm nổi tiếng l&agrave;m n&ecirc;n thương hiệu Habeco c&oacute; thể kể đến như Bia hơi H&agrave; Nội, Bia lon H&agrave; Nội, Bia Tr&uacute;c Bạch, Hanoi Beer Premium&hellip; Với b&iacute; quyết c&ocirc;ng nghệ &ndash; truyền thống gần 130 năm, hệ thống thiết bị hiện đại, đội ngũ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n l&agrave;nh nghề, c&aacute;c sản phẩm của HABECO đ&atilde; trở th&agrave;nh niềm tự h&agrave;o của thương hiệu Việt v&agrave; được ph&acirc;n phối rộng r&atilde;i tới c&aacute;c thị trường nước ngo&agrave;i như Đ&agrave;i Loan, H&agrave;n Quốc, Anh, Đức, Mỹ, A</p>\n\n<p><strong>Bia H&agrave; Nội Premium: G&igrave;n giữ tin hoa &ndash; N&acirc;ng tầm vị thế</strong></p>\n\n<p>B&iacute; quyết để tạo ra d&ograve;ng bia thơm ngon của Hanoi Beer Premium nằm ở phương ph&aacute;p l&ecirc;n men chuyển h&oacute;a tới độ, kết hợp với sinh lực tr&agrave;n đầy của d&ograve;ng men trẻ nhằm để lại dư vị thuần khiết, m&ugrave;i hương thơm m&aacute;t quyến rũ từ những nụ hoa houblon từ Cộng h&ograve;a S&eacute;c thơ mộng. &ldquo;C&aacute;c bạn đ&atilde; s&aacute;ng tạo tới mức kh&ocirc;ng ngờ&rdquo; &ndash; Tiến sỹ Bill Simpson, chuy&ecirc;n gia nếm bia h&agrave;ng đầu thế giới đ&atilde; nhận x&eacute;t.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u.</li>\n</ul>',349000,4,4,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 10:15:05','2023-03-24 10:15:05',NULL),(41,'GBN-COMBO-TH','combo-tan-huong','Combo Tận hưởng','c81881ce-45bf-41dd-98e5-d896ba38aff9','Combo Tận hưởng','<p><strong>Th&ugrave;ng bia Sapporo - 24 lon 330ml</strong>&nbsp;&aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Dung T&iacute;ch: 330ml</p>\n\n<p>Hạn Sử Dụng: 12 Th&aacute;ng</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Snack Da c&aacute; trứng muối G</strong>&nbsp;thơm b&ugrave;i ngọt vị lại gi&ograve;n tan đảm bảo chinh phục gi&aacute;c quan của bạn ngay từ lần đầu thưởng thức. Vị ngon từ da c&aacute; tươi miếng nguy&ecirc;n được xử l&yacute; c&ocirc;ng phu bằng c&ocirc;ng nghệ chi&ecirc;n ch&acirc;n kh&ocirc;ng hiện đại gi&uacute;p miếng da kh&ocirc;ng b&aacute;m dầu, giữ lại tối đa dưỡng chất vốn c&oacute; của c&aacute; (omega 3), kết hợp độc đ&aacute;o với trứng muối thơm ngọt b&eacute;o b&ugrave;i k&iacute;ch th&iacute;ch tối đa vị gi&aacute;c. Kh&ocirc;ng chỉ ngon l&agrave;nh từ nguy&ecirc;n liệu, b&eacute;o ngọt từ gia vị tinh tế, Da c&aacute; trứng muối G c&ograve;n hấp dẫn bởi bao b&igrave; hiện đại, g&oacute;i nhỏ dễ sử dụng, chỉ cần x&eacute; cạnh l&agrave; bạn c&oacute; thể thưởng thức ngay m&oacute;n snack thơm l&agrave;nh.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Khối lượng: 50g</p>\n\n<p>Hạn Sử Dụng: 6 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p>Sản phẩm của : C&ocirc;ng ty TNHH Feddy</p>',1235000,4,2,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:23:14','2023-04-04 10:07:43','2023-04-04 10:07:43'),(42,'asdadsdasd','asdsda','asdsda','19582bfe-2399-4291-b276-37a3c2c35f1a','asdad',NULL,1231313213,12,13,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-17 10:58:18','2023-03-17 10:58:25','2023-03-17 10:58:25'),(43,'CB2TBTB-24L330ML-PBT','combo-2-thung-bia-truc-bach-thung-24-lon-330ml-phien-ban-tet','Combo 2 Thùng Bia Trúc Bạch – Thùng 24 lon 330ml – Phiên bản Tết','5076720c-5354-46e0-9e1a-9b308fc2d298','Thông tin sản phẩm<br><br>\n\n• Dung tích: 330ml/lon<br>\n\n• Nồng độ cồn: 5.1 ± 0.4%<br>\n\n• Thành phần: nước, malt, gạo, đường, hoa Houblon<br>\n\n• HSD: 9 tháng kể từ ngày sản xuất<br>\n\nThời gian phục vụ giao hàng<br><br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><b>COMBO 2 TH&Ugrave;NG BIA TR&Uacute;C BẠCH &ndash; TH&Ugrave;NG 24 LON 330ML &ndash; PHI&Ecirc;N BẢN TẾT</b></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Dung t&iacute;ch: 330ml/lon</p>\n\n<p>&bull; Nồng độ cồn: 5.1 &plusmn; 0.4%</p>\n\n<p>&bull; Th&agrave;nh phần: nước, malt, gạo, đường, hoa Houblon</p>\n\n<p>&bull; HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Bia Tr&uacute;c Bạch: Kiệt t&aacute;c chinh phục đỉnh cao</strong></p>\n\n<p>Tr&uacute;c Bạch l&agrave; loại bia nội đầu ti&ecirc;n của Việt Nam khi sản phẩm n&agrave;y ra đời v&agrave;o năm 1958. D&ograve;ng bia cao cấp được kết tinh từ hoa bia Saaz &ndash; một trong bốn loại hoa bia qu&yacute; tộc của thế giới được trồng duy nhất tại thung lũng Zatec v&agrave; l&uacute;a mạch vụ xu&acirc;n thu hoạch từ những v&ugrave;ng nguy&ecirc;n liệu nổi tiếng của Ph&aacute;p v&agrave; Cộng h&ograve;a S&eacute;c. D&ograve;ng bia m&agrave;u v&agrave;ng &oacute;ng v&agrave; trong suốt như mật ong. Khi r&oacute;t, bọt bia trắng, d&agrave;y, xốp. Đặc biệt, khi uống, bia c&oacute; vị đắng nhẹ, vị đắng n&agrave;y từ từ chuyển sang vị ngọt dịu của mạch nha thượng hạng. Vị bia độc đ&aacute;o n&agrave;y l&agrave; kết quả của qu&aacute; tr&igrave;nh l&ecirc;n men tự nhi&ecirc;n d&agrave;i ng&agrave;y, l&acirc;u gấp 2 &ndash; 3 lần so với c&aacute;c loại bia th&ocirc;ng thường.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<p>&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</p>\n\n<p>&bull; Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</p>\n\n<p>&bull; Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</p>\n\n<p>&bull; Ngon hơn khi uống lạnh (10-15̊C)</p>\n\n<p>&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u</p>',910000,4,10,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 10:49:51','2023-03-24 10:49:51',NULL),(44,'BHNB-24L-330ml','bia-hanoi-bold-thung-24-lon-330ml','Bia Hanoi BOLD – Thùng 24 lon 330ml','ea2560ae-0a73-44e5-88fb-40fb59f8871a','SẢN PHẨM CHỈ GIAO TẠI HÀ NỘI\n\nThông tin sản phẩm\n• Dung tích: 330ml/lon\n• Nồng độ cồn: 4.8 ± 0.4%\n• Thành phần: nước, malt, gạo, đường, hoa Houblon\n• HSD: 9 tháng kể từ ngày sản xuất\n\nThời gian phục vụ giao hàng\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA HANOI BOLD &ndash; TH&Ugrave;NG 24 LON 330ML&nbsp;</strong></p>\n\n<p><strong>SẢN PHẨM CHỈ GIAO TẠI H&Agrave; NỘI</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Dung t&iacute;ch: 330ml/lon</p>\n\n<p>&bull; Nồng độ cồn: 4.8 &plusmn; 0.4%</p>\n\n<p>&bull; Th&agrave;nh phần: nước, malt, gạo, đường, hoa Houblon</p>\n\n<p>&bull; HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Hanoi BOLD&amp;Light: Đậm c&aacute; t&iacute;nh &ndash; Chuẩn chất men</strong></p>\n\n<p>Hanoi BOLD &amp; Hanoi Light l&agrave; cặp sản phẩm d&agrave;nh cho giới trẻ &ndash; thế hệ lu&ocirc;n hướng tới những trải nghiệm kh&aacute;c biệt v&agrave; đột ph&aacute;. Hanoi BOLD với chất men của kh&aacute;t khao, chinh phục v&agrave; bứt ph&aacute;, sẽ l&agrave; người đồng h&agrave;nh l&yacute; tưởng của những t&iacute;n đồ của y&ecirc;u th&iacute;ch trải nghiệm kh&aacute;m ph&aacute;.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<p>&bull; Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</p>\n\n<p>&bull; Kh&o