ull; Thời gian thực hiện khuyến mại: từ 15/03/2022 đến 31/07/2022<br />\n&bull; Khu vực &aacute;p dụng: tất cả c&aacute;c tỉnh, th&agrave;nh phố từ Huế trở v&agrave;o ph&iacute;a Nam</p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong><br />\n&bull; Dung t&iacute;ch: 330ml/lon<br />\n&bull; Nồng độ cồn: 4.3 &plusmn; 0.4%<br />\n&bull; Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon<br />\n&bull; HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>HABECO &ndash; Thương hiệu đồ uống h&agrave;ng đầu Việt Nam</strong><br />\nTrải qua hơn 130 năm lịch sử h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển, đến nay, HABECO đ&atilde; trở th&agrave;nh một trong c&aacute;c doanh nghiệp h&agrave;ng đầu của ng&agrave;nh Đồ uống Việt Nam. Những d&ograve;ng sản phẩm nổi tiếng l&agrave;m n&ecirc;n thương hiệu HABECO như Bia H&agrave; Nội, Bia Hơi H&agrave; Nội, Bia Tr&uacute;c Bạch, Hanoi Beer Premium&hellip; đ&atilde; nhận được sự tin y&ecirc;u của người ti&ecirc;u d&ugrave;ng về cả chất lượng v&agrave; phong c&aacute;ch, chinh phục những người s&agrave;nh bia trong v&agrave; ngo&agrave;i nước. Với b&iacute; quyết c&ocirc;ng nghệ &ndash; truyền thống trăm năm, hệ thống thiết bị hiện đại, đội ngũ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n l&agrave;nh nghề, c&aacute;c sản phẩm của HABECO đ&atilde; trở th&agrave;nh niềm tự h&agrave;o của thương hiệu Việt v&agrave; được ph&acirc;n phối rộng r&atilde;i tới c&aacute;c thị trường nước ngo&agrave;i như Đ&agrave;i Loan, H&agrave;n Quốc, Anh, Đức, Mỹ, A</p>\n\n<p><strong>Bia H&agrave; Nội nh&atilde;n xanh: Hương bia truyền thống &ndash; Sức sống miền Trung</strong><br />\nVới mong muốn đ&aacute;p ứng tốt hơn nhu cầu của người ti&ecirc;u d&ugrave;ng tr&ecirc;n mọi miền đất nước, Bia H&agrave; Nội nh&atilde;n xanh l&agrave; sự kết hợp giữa tinh hoa trong hơn 120 năm của Bia H&agrave; Nội v&agrave; khẩu vị bia đặc trưng của người d&acirc;n nơi miền Trung Tổ quốc. Sở hữu chất lượng tuyệt hảo, được đ&uacute;c kết từ những nguy&ecirc;n liệu bia h&agrave;ng đầu, Bia H&agrave; Nội nh&atilde;n xanh mang đến trải nghiệm kh&oacute; qu&ecirc;n cho người y&ecirc;u bia khi tận hưởng hương vị &ecirc;m dịu v&agrave; lắng đọng trước cảnh đẹp của biển xanh c&aacute;t trắng nơi miền Trung đất nước.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C).</li>\n	<li>N&ecirc;n d&ugrave;ng ngay sau khi mở lon hoặc bảo quản lạnh để sử</li>\n</ul>',199000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 09:25:15','2023-03-24 09:25:15',NULL),(46,'GBN-BBT-20L','hcm-bom-bia-tuoi-20l','HCM - Bom bia tươi 20L','1bd2b7d2-844c-4add-9334-f96566d759d1','HCM - Bom bia tươi 20L','<p><strong>Bia tươi Sapporo Premium loại&nbsp;20L</strong>&nbsp;được sản xuất theo quy tr&igrave;nh 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p>Bia tươi Sapporo Premium mang đến hương vị bia cao cấp với độ cồn 5.0%, sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. D&ograve;ng sản phẩm bia tươi Sapporo Premium được phục vụ với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong, mang lại những khoảnh khắc &ecirc;m đằm sảng kho&aacute;i. Tận hưởng bia tươi Sapporo Premium với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của Sapporo.</p>',1401000,4,2,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:31:56','2023-04-04 10:07:43','2023-04-04 10:07:43'),(47,'GBN-SPRPB10035','moi-sapporo-premium-beer-100-35-do-con','[MỚI] SAPPORO PREMIUM BEER 100 - 3.5% Độ cồn','bb4f8bf0-f077-486c-be7d-d7304fd7c575','[MỚI] SAPPORO PREMIUM BEER 100 - 3.5% Độ cồn','<p><strong>Th&ugrave;ng bia Sapporo Premium Beer 100 - 24 lon 330ml 100%</strong> đại mạch, vị bia độc đ&aacute;o với&nbsp;<strong>3,5% nồng độ cồn</strong>, &aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>Xuất Xứ: Việt Nam<br />\nDung T&iacute;ch: 330ml&nbsp; &nbsp;Độ cồn: 3,5%<br />\nHạn Sử Dụng: 12 Th&aacute;ng</p>',415000,4,9,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:08:50','2023-04-04 10:20:04',NULL),(48,'SJHIM-WATERMELON-360-12','ruou-soju-him-watermelon','Rượu Soju HIM Watermelon','dd9e3856-7a27-4748-8a30-33c579ad98bb','Thể tích: 360ml\nNồng độ: 12%','<p>Xuất xứ: H&agrave;n Quốc Độ cồn: 12% M&ocirc; tả sản phẩm: Rượu Soju HIM nhập khẩu 100% từ H&agrave;n Quốc, độ cồn nhẹ, &ecirc;m đằm v&agrave; hương vị tươi m&aacute;t dễ chịu C&aacute;ch sử dụng: Uớp lạnh v&agrave; uống trực tiếp hoặc pha chế c&ugrave;ng c&aacute;c loại nước ngọt (Sprite), Soda, Yakult... Th&iacute;ch hợp khi uống k&egrave;m c&aacute;c m&oacute;n nướng, lẩu, đồ ăn chi&ecirc;n r&aacute;n...</p>',65000,3,5,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-28 07:42:34','2023-03-28 07:51:16',NULL),(49,'CB2BHN-24L330ML-VT','combo-2-thung-bia-ha-noi-thung-24-lon-330ml-phien-ban-tet','Combo 2 Thùng Bia Hà Nội – Thùng 24 lon 330ml – Phiên bản Tết','5b168f37-c2fe-48e6-9e31-b89f9c2e4654','Thông tin sản phẩm<br><br>\n\nDung tích: 330ml/lon<br>\nNồng độ cồn: 4.6 ± 0.4%<br>\nThành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\nHSD: 12 tháng kể từ ngày sản xuất<br>\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<h3><strong>Combo 2 Th&ugrave;ng Bia H&agrave; Nội &ndash; Th&ugrave;ng 24 lon 330ml &ndash; Phi&ecirc;n bản Tết</strong></h3>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<ul>\n	<li>Dung t&iacute;ch: 330ml/lon</li>\n	<li>Nồng độ cồn: 4.6 &plusmn; 0.4%</li>\n	<li>Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon</li>\n	<li>HSD: 12 th&aacute;ng kể từ ng&agrave;y sản xuất</li>\n</ul>\n\n<p><strong>Bia H&agrave; Nội: G&igrave;n giữ tinh hoa &ndash; N&acirc;ng tầm vị thế</strong></p>\n\n<p>Lần đầu ti&ecirc;n được giới thiệu với người y&ecirc;u bia Việt Nam v&agrave;o năm 1992, chất lượng cũng như h&igrave;nh thức tiện lợi của Bia lon H&agrave; Nội l&agrave; l&yacute; do khiến sản phẩm n&agrave;y lu&ocirc;n được nhắm tới l&agrave;m qu&agrave; tặng v&agrave;o những dịp lễ Tết hay những dịp kỷ niệm quan trọng. Bia lon H&agrave; Nội l&agrave; chất x&uacute;c t&aacute;c quan trọng khiến cho c&acirc;u chuyện những dịp tụ tập th&ecirc;m vui vẻ v&agrave; h&agrave;o hứng.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C). Nếu mở lon phải d&ugrave;ng ngay hoặc bảo quản lạnh nếu muốn d&ugrave;ng l&acirc;u.</li>\n</ul>',540000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 08:20:54','2023-03-24 08:48:48',NULL),(50,'VK-PYCCKOE-1750-35','vodka-russkoe-pole-1750ml-1','Vodka Русское поле 1750ml','16ed8e75-0d15-496e-9e20-9f6b050944db','Thể tích: 1750ml\nNồng độ: 35%','<p>Xuất xứ: Nga&nbsp;</p>\n\n<p>Quy c&aacute;ch: 09 chai/th&u