','0fa2e37c-3a1d-42f6-9aaa-a61e9657258d','Bia tươi Tiệp Zamky Pilsner','<p>Zamky - D&ograve;ng bia tươi mang hương vị đậm đ&agrave; đặc trưng từ đất nước Tiệp Khắc. Với b&iacute; quyết ủ bia truyền thống c&ugrave;ng quy tr&igrave;nh xử l&yacute; khắt khe, Bia Zamky chất lượng tuyệt hảo l&agrave; lựa chọn số một cho những ai y&ecirc;u th&iacute;ch hương vị bia Tiệp. Vị đắng nhẹ, ngọt dịu, hương thơm đặc trưng từ hoa bia, hậu vị b&eacute;o ngậy từ l&uacute;a mạch l&agrave; những g&igrave; thực kh&aacute;ch c&oacute; thể dễ d&agrave;ng cảm nhận khi thưởng thức Zamky. Bia Zamky được sản xuất ở Việt Nam theo c&ocirc;ng nghệ v&agrave; c&ocirc;ng thức của Tiệp Khắc.</p>',75000,11,1,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:50:05','2023-03-20 09:12:39',NULL),(57,'GBN-SPRP6L-650','sapporo-premium-6-lon-650ml','Sapporo Premium 6 lon 650ml','2868959d-6d10-4b83-8790-0721ea2fa686','Sapporo Premium 6 lon 650ml','<p><strong>Th&ugrave;ng Bia Sapporo Premium - 6 lon 650ml</strong>&nbsp;&aacute;p dụng quy tr&igrave;nh sản xuất bia 8 bước nghi&ecirc;m ngặt: Chuẩn bị nguy&ecirc;n liệu, Nấu - Lọc b&atilde;, Đun s&ocirc;i v&agrave; bổ sung hoa bia, Kết lắng, L&agrave;m lạnh v&agrave; l&ecirc;n men, Ủ, Lọc v&agrave; Đ&oacute;ng g&oacute;i phục vụ. Trải qua qu&aacute; tr&igrave;nh n&agrave;y, hương vị bia đ&atilde; được điều chỉnh c&acirc;n bằng hơn, tạo cảm gi&aacute;c sảng kho&aacute;i nhẹ nh&agrave;ng, ph&ugrave; hợp khẩu vị người Việt.</p>\n\n<p>&nbsp;</p>\n\n<p>Sapporo chọn lọc nguy&ecirc;n liệu v&agrave; &aacute;p dụng c&ocirc;ng nghệ Fresh Keep độc quyền gi&uacute;p bia lu&ocirc;n tươi mới v&agrave; nguy&ecirc;n vị trong suốt thời gian bảo quản. Nh&agrave; m&aacute;y sản xuất bia hiện đại v&agrave; quy tr&igrave;nh sản xuất kh&eacute;p k&iacute;n ti&ecirc;n tiến đều được đặt tại Việt Nam.</p>\n\n<p><br />\nMới đ&acirc;y, Sapporo cũng đ&atilde; cho ra mắt thiết kế bao b&igrave; mới v&agrave; n&acirc;ng cấp hương vị bia với một tinh thần lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng h&igrave;nh ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong d&ograve;ng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt s&aacute;nh mịn, 7 phần bia s&aacute;ng trong. H&igrave;nh ảnh bia tươi với lớp bọt căng đầy mang đến cảm gi&aacute;c ngon miệng, sảng kho&aacute;i, gợi l&ecirc;n vị &ecirc;m đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất Xứ: Việt Nam</p>\n\n<p>Dung T&iacute;ch: 650ml</p>\n\n<p>Hạn Sử Dụng: 12 Th&aacute;ng</p>',385000,4,9,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 08:20:29','2023-04-04 10:20:04',NULL),(58,'VK-CSS-500-30','vodka-ca-sau-xanh','Vodka Cá Sấu Xanh','66326d3f-b137-4e3d-ba23-110e4208862c','Thể tích: 500ml\nNồng độ: 30%','<p>Xuất xứ: Việt Nam&nbsp;</p>\n\n<p>Quy c&aacute;ch: 20 chai/th&ugrave;ng&nbsp;</p>\n\n<p>C&aacute;ch sử dụng: Ngon nhất khi uống lạnh. Kết hợp l&agrave;m nền cocktail. Ph&ugrave; hợp với hầu hết tất cả c&aacute;c m&oacute;n ăn Việt Nam như nướng lẩu , hoặc c&aacute;c bữa cơm gia đ&igrave;nh.&nbsp;</p>\n\n<p>M&ocirc; tả sản phẩm: Rượu vodka C&aacute; Sấu Xanh l&agrave; sản phẩm li&ecirc;n doanh, nhập khẩu nguy&ecirc;n liệu 100% v&agrave; sản xuất tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ của Nga với quy tr&igrave;nh 7 lần lọc bằng ion Silver. Đem lại hương vị rượu Vodka Nga đ&uacute;ng chuẩn với gi&aacute; th&agrave;nh hợp l&yacute; cho người ti&ecirc;u d&ugrave;ng.</p>',100000,7,16,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:09:40','2023-04-12 10:25:42',NULL),(59,'RV-MR-500-29','ruou-ngam-rom-vang-mo-rung-500ml','Rượu ngâm Rơm Vàng mơ rừng (500ml)','cde3ae85-7180-410c-b200-ec306deceef8','Thể tích: 500ml\nNồng độ: 29%','<p>Xuất xứ: Việt Nam&nbsp;</p>\n\n<p>Quy c&aacute;ch: 20 chai/th&ugrave;ng&nbsp;</p>\n\n<p>C&aacute;ch sử dụng: Ngon nhất khi uống lạnh hoặc uống chung với đ&aacute;. C&oacute; thể d&ugrave;ng l&agrave;m nền c&aacute;c loại cocktail để giải kh&aacute;t m&ugrave;a h&egrave;.&nbsp;</p>\n\n<p>M&ocirc; tả sản phẩm: Rượu ng&acirc;m từ cốt mơ rừng T&acirc;y Bắc, sử dụng c&ocirc;ng nghệ băm nhỏ hiện đại gi&uacute;p giữ nguy&ecirc;n tinh chất mơ rừng, tốt cho sức khỏe. Hương vị thanh ngọt, &ecirc;m đằm, loại bỏ methanol độc hại, an to&agrave;n cho sức khỏe.</p>',130000,1,3,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 09:26:41','2023-03-20 09:42:02',NULL),(60,'qwerqwer','qwerqwer','qwerqwer','1bf56e32-1c9c-4f4f-994b-e813b7f32f14','2342342','<p>34234234</p>',234,12,5,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-17 11:03:17','2023-03-17 11:03:25','2023-03-17 11:03:25'),(61,'BTC-HB-3004575','bia-thu-cong-harlems-brothers','Bia thủ công Harlems Brothers','0f91b063-fbae-4df6-884f-9e6289f63ff5','Thể tích: 330ml\nIBU: 45\nABV: 7.5%','<p>M&ocirc; tả sản phẩm: Harlem Brother l&agrave; d&ograve;ng bia thủ c&ocirc;ng đại diện cho những phong vị c&aacute; t&iacute;nh mang &ldquo;chất&rdquo; ri&ecirc;ng. C&ocirc;ng thức l&acirc;u đời từ những tu viện nấu bia cổ xưa tại Bỉ vẫn được nghi&ecirc;n cứu v&agrave; lưu truyền, đảm bảo sự nguy&ecirc;n bản trong hương vị của bia Harlem Brothers. Đ&aacute;nh gi&aacute; kh&aacute;ch h&agrave;ng:</p>',150000,2,1,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:43:15','2023-03-20 09:34:40',NULL),(62,'rrvtm300','ruou-rom-vang-tao-meo-300ml-6','Rượu Rơm Vàng - Táo Mèo (300ml) 6','9a580c25-7906-4a01-9d3c-e968a4473190','Quy cách: 20 chai/thùng \n\nCách sử dụng: Ngon nhất khi uống lạnh hoặc uống chung với đá. Có thể dùng làm nền các loại cocktail để giải khát mùa hè. \n\nMô tả sản phẩm: Rượu ngâm từ cốt táo mèo từ Tây Bắc chứa hàm lượng vitamin khoáng chất cao, tốt cho sức khỏe. Độ cồn thấp, dễ uống, vị chua ngọt hài hòa, chát nhẹ, không đau đầu sau khi uống.','<p>Thời gian đặt h&agrave;ng v&agrave; giao h&agrave;ng:</p>\n\n<p>Đặt h&agrave;ng trước 10h s&aacute;ng: giao h&agrave;ng trong ng&agrave;y</p>\n\n<p>Đặt h&agrave;ng sau 10h s&aacute;ng: giao h&agrave;ng trong ng&agrave;y h&ocirc;m sau</p>',65000,12,3,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-17 11:04:21','2023-03-20 07:35:50','2023-03-20 07:35:50'),(63,'BHN-24L330ML-KMHMN','bia-ha-noi-thung-24-lon-330ml-khuyen-mai-he-mien-nam','Bia Hà Nội – Thùng 24 lon 330ml – Khuyến mại hè Miền Nam','d1732eed-adcc-415a-975f-b73333c17cc2','Thông tin sản phẩm<br><br>\n• Dung tích: 330ml/lon<br>\n• Nồng độ cồn: 4.6 ± 0.4%<br>\n• Thành phần: nước, mạch nha, gạo, đường, hoa Houblon<br>\n• HSD: 12 tháng kể từ ngày sản xuất<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>BIA H&Agrave; NỘI &ndash; TH&Ugrave;NG 24 LON 330ML &ndash; KHUYẾN MẠI H&Egrave; MIỀN NAM</strong></p>\n\n<p><strong>SẢN PHẨM CHỈ GIAO Ở TH&Agrave;NH PHỐ HỒ CH&Iacute; MINH</strong></p>\n\n<p>Đại diện cho tinh hoa ẩm thực Thủ Đ&ocirc;, Bia H&agrave; Nội nay đ&atilde; c&oacute; mặt tại miền Nam để chia sẻ bản sắc ri&ecirc;ng cho những người bạn phương Nam mến kh&aacute;ch v&agrave; cho những người con xa xứ lu&ocirc;n mang trong m&igrave;nh niềm tự h&agrave;o v&agrave; nỗi nhớ da diết về qu&ecirc; hương.<br />\nTri &acirc;n Qu&yacute; kh&aacute;ch h&agrave;ng phương Nam, lần đầu ti&ecirc;n, Bia H&agrave; Nội tr&acirc;n trọng giới thiệu Chương tr&igrave;nh khuyến mại Đặc biệt từ Huế trở v&agrave;o Nam: &ldquo;Bừng sắc h&egrave; c&ugrave;ng Bia h&agrave; Nội&rdquo;<br />\n&bull; Thời gian thực hiện khuyến mại: từ 15/03/2022 đến 31/07/2022<br />\n&bull; Khu vực &aacute;p dụng: tất cả c&aacute;c tỉnh, th&agrave;nh phố từ Huế trở v&agrave;o ph&iacute;a Nam</p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong><br />\n&bull; Dung t&iacute;ch: 330ml/lon<br />\n&bull; Nồng độ cồn: 4.6 &plusmn; 0.4%<br />\n&bull; Th&agrave;nh phần: nước, mạch nha, gạo, đường, hoa Houblon<br />\n&bull; HSD: 12 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>HABECO &ndash; Thương hiệu đồ uống h&agrave;ng đầu Việt Nam</strong><br />\nTrải qua hơn 130 năm lịch sử h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển, đến nay, Habeco đ&atilde; trở th&agrave;nh một trong c&aacute;c doanh nghiệp h&agrave;ng đầu của ng&agrave;nh Đồ uống Việt Nam. Những d&ograve;ng sản phẩm nổi tiếng l&agrave;m n&ecirc;n thương hiệu Habeco như Bia H&agrave; Nội, Bia hơi H&agrave; Nội, Bia Tr&uacute;c Bạch, Hanoi Beer Premium&hellip; đ&atilde; nhận được sự tin y&ecirc;u của người ti&ecirc;u d&ugrave;ng về cả chất lượng v&agrave; phong c&aacute;ch, chinh phục những người s&agrave;nh bia trong v&agrave; ngo&agrave;i nước. Với b&iacute; quyết c&ocirc;ng nghệ &ndash; truyền thống trăm năm, hệ thống thiết bị hiện đại, đội ngũ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n l&agrave;nh nghề, c&aacute;c sản phẩm của HABECO đ&atilde; trở th&agrave;nh niềm tự h&agrave;o của thương hiệu Việt v&agrave; được ph&acirc;n phối rộng r&atilde;i tới c&aacute;c thị trường nước ngo&agrave;i như Đ&agrave;i Loan, H&agrave;n Quốc, Anh, Đức, Mỹ, A</p>\n\n<p><strong>Bia H&agrave; Nội: G&igrave;n giữ tinh hoa &ndash; N&acirc;ng tầm vị thế</strong><br />\nLần đầu ti&ecirc;n được giới thiệu với người y&ecirc;u bia Việt Nam v&agrave;o những năm 90, Bia H&agrave; Nội lu&ocirc;n được nhiều người ti&ecirc;u d&ugrave;ng tin y&ecirc;u lựa chọn, l&agrave; chất x&uacute;c t&aacute;c quan trọng khiến cho c&acirc;u chuyện những dịp tụ tập th&ecirc;m vui vẻ v&agrave; h&agrave;o hứng. Theo thời gian, thưởng thức bia H&agrave; Nội đ&atilde; trở th&agrave;nh một tinh hoa văn h&oacute;a. C&ugrave;ng với cuộc sống ng&agrave;y một đi l&ecirc;n, với những giao thoa của Việt Nam hiện đại v&agrave; gi&agrave;u bản sắc truyền thống, Bia H&agrave; Nội dần chuyển m&igrave;nh để &ldquo;bắt s&oacute;ng&rdquo; với những xu hướng mới. Song, những gi&aacute; trị văn h&oacute;a đẹp đẽ lu&ocirc;n được Bia H&agrave; Nội lưu giữ, n&acirc;ng niu để thương hiệu bia của người Việt Nam được n&acirc;ng tầm vị thế.<br />\nMỗi ngụm bia bạn thưởng thức, l&agrave; bạn đang nh&acirc;m nhi một n&eacute;t văn ho&aacute; của H&agrave; Nội sau một thế kỷ, nh&acirc;m nhi một tinh hoa hội tụ từ b&agrave;n tay con người Việt Nam.</p>\n\n<p><strong>Lưu &yacute; v&agrave; bảo quản</strong></p>\n\n<ul>\n	<li>Sản phẩm d&agrave;nh cho người tr&ecirc;n 18 tuổi</li>\n	<li>Kh&ocirc;ng d&agrave;nh cho phụ nữ đang mang thai</li>\n	<li>Thưởng thức c&oacute; tr&aacute;ch nhiệm, đ&atilde; uống đồ uống c&oacute; cồn th&igrave; kh&ocirc;ng l&aacute;i xe</li>\n	<li>Ngon hơn khi uống lạnh (10-15̊C)</li>\n	<li>Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng mặt trời (&lt;25̊C).</li>\n	<li>N&ecirc;n d&ugrave;ng ngay sau khi mở lon hoặc bảo quản lạnh để sử dụng được l&acirc;u.</li>\n</ul>',273000,4,8,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-24 09:29:08','2023-03-24 09:29:08',NULL),(64,'TBIPAC-6C330ML','truc-bach-ipa-craft-hop-6-chai-330ml','Trúc Bạch IPA Craft – Hộp 6 chai 330ml','cca49cf4-40a2-44f8-aaaa-217e7ac129ae','Thông tin sản phẩm:<br><br>\n• Dung tích: 330ml/chai<br>\n• Nồng độ cồn: 6.5 ± 0.5%<br>\n• Thành phần: nước, malt, hoa Houblon, nấm men bia<br>\n• Quy cách đóng gói: 6 chai/ hộp<br><br>\n\nThời gian phục vụ giao hàng<br>\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>Tr&uacute;c Bạch IPA Craft &ndash; Hộp 6 chai 330ml</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm:</strong><br />\n&bull; Dung t&iacute;ch: 330ml/chai<br />\n&bull; Nồng độ cồn: 6.5 &plusmn; 0.5%<br />\