&bull; Dung t&iacute;ch: 350ml/chai<br />\n&bull; Th&agrave;nh phần: nước được khai th&aacute;c từ nguồn nước ngầm tự nhi&ecirc;n<br />\n&bull; HSD: 2 năm kể từ ng&agrave;y sản xuất<br />\n&bull; Bảo quản nơi kh&ocirc; r&aacute;o, sạch sẽ, tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp.</p>\n\n<p>HABECO &ndash; Thương hiệu đồ uống h&agrave;ng đầu Việt Nam<br />\nNhững d&ograve;ng sản phẩm nổi tiếng l&agrave;m n&ecirc;n thương hiệu HABECO c&oacute; thể kể đến như Bia hơi H&agrave; Nội, Bia lon H&agrave; Nội, Bia Tr&uacute;c Bạch, Hanoi Beer Premium&hellip; Với b&iacute; quyết c&ocirc;ng nghệ &ndash; truyền thống gần 130 năm, hệ thống thiết bị hiện đại, đội ngũ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n l&agrave;nh nghề, c&aacute;c sản phẩm của HABECO đ&atilde; trở th&agrave;nh niềm tự h&agrave;o của thương hiệu Việt v&agrave; được ph&acirc;n phối rộng r&atilde;i tới c&aacute;c thị trường nước ngo&agrave;i như Đ&agrave;i Loan, H&agrave;n Quốc, Anh, Đức, Mỹ,&hellip;</p>\n\n<p>Nước uống đ&oacute;ng chai UniAqua: Thật sảng kho&aacute;i<br />\nBắt nguồn từ mạch nước ngầm tự nhi&ecirc;n, UniAqua tiếp tục trải qua qu&aacute; tr&igrave;nh sản xuất được &aacute;p dụng những c&ocirc;ng nghệ ti&ecirc;n tiến v&agrave; khử tr&ugrave;ng bằng tia cực t&iacute;m dưới sự kiểm so&aacute;t chặt chẽ bởi d&acirc;y chuyền hiện đại bậc nhất. Sở hữu vị ngon tươi m&aacute;t, HABECO tự h&agrave;o khẳng định UniAqua l&agrave; sản phẩm nước uống đ&oacute;ng chai c&oacute; chất lượng h&agrave;ng đầu tr&ecirc;n thị trường Việt Nam.</p>',109000,9,7,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-29 08:22:27','2023-03-29 08:22:27',NULL),(74,'HRK-180-14','ruou-mo-nhat-ban-haruka-coc','Rượu mơ Nhật Bản Haruka cốc','4c8db299-53bd-4728-bde0-bd06bf126b69','Thể tích: 820ml\nNồng độ: 14%','<p>Quy c&aacute;ch: 12 chai/th&ugrave;ng&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Xuất xứ: Việt Nam&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>C&aacute;ch sử dụng: Ngon nhất khi uống lạnh, uống chung với đ&aacute; hoặc pha chế cocktail. Uống ấm v&agrave;o m&ugrave;a đ&ocirc;ng gi&uacute;p tăng hương vị đậm đ&agrave;, ph&ograve;ng c&aacute;c bệnh h&ocirc; hấp, đường ruột, giải tỏa stress. L&agrave;m đẹp da v&agrave; hỗ trợ giảm c&acirc;n hiệu quả.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>M&ocirc; tả sản phẩm: Haruka từ mơ tươi Nhật Bản, đường ph&egrave;n tinh khiết v&agrave; rượu sochu. Vị nhẹ nh&agrave;ng chua ngọt dễ uống, hương thơm tươi m&aacute;t tự nhi&ecirc;n, Haruka l&agrave; sản phẩm đặc biệt ph&ugrave; hợp cho những buổi d&atilde; ngoại, những bữa li&ecirc;n hoan th&ecirc;m phần th&uacute; vị. Với bao b&igrave; bắt mắt c&ugrave;ng t&aacute;c dụng nổi bật tốt cho sức khỏe, Haruka c&ograve;n th&iacute;ch hợp để l&agrave;m qu&agrave; tặng &yacute; nghĩa d&agrave;nh tặng cho những người th&acirc;n y&ecirc;u trong những dịp đặc biệt.</p>',60000,10,13,'active',0,0,'{\"meta\": {\"title\": null, \"keyword\": null, \"description\": null}}','2023-03-20 07:24:13','2023-03-20 09:17:31',NULL),(75,'147','combo-03-thung-sapporo-premium-beer-12-lon-500ml-hop-qua-tet-g-kitchen','Combo 03 thùng Sapporo Premium Beer 12 lon 500ml + Hộp quà Tết G-Kitchen','19314547-4f47-4ac2-8c0e-28aeb2fa9504','Hộp quà tết G-Kitchen bao gồm:<br />\r\n- 1 hộp khô gà lá chanh 120g<br />\r\n- 1 lạp xưởng vị gia truyền 250g<br />\r\n- 10 bao lì xì.','<p><strong>Thùng bia Sapporo - 12&nbsp;lon 500ml</strong> áp dụng quy trình sản xuất bia 8 bước nghiêm ngặt: Chuẩn bị nguyên liệu, Nấu - Lọc bã, Đun sôi và bổ sung hoa bia, Kết lắng, Làm lạnh và lên men, Ủ, Lọc và Đóng gói phục vụ. Trải qua quá trình này, hương vị bia đã được điều chỉnh cân bằng hơn, tạo cảm giác sảng khoái nhẹ nhàng, phù hợp khẩu vị người Việt.</p>\r\n\r\n<p>Sapporo chọn lọc nguyên liệu và áp dụng công nghệ Fresh Keep độc quyền giúp bia luôn tươi mới và nguyên vị trong suốt thời gian bảo quản. Nhà máy sản xuất bia hiện đại và quy trình sản xuất khép kín tiên tiến đều được đặt tại Việt Nam.</p>\r\n\r\n<p><br />\r\nMới đây, Sapporo cũng đã cho ra mắt thiết kế bao bì mới và nâng cấp hương vị bia với một tinh thần luôn sẵn sàng đồng hành cùng những người thưởng bia đẳng cấp. Thiết kế mới sử dụng hình ảnh ly bia tươi, &quot;ngọn cờ đầu&quot; trong dòng sản phẩm Sapporo Premium, với chuẩn quy tắc 3 phần bọt sánh mịn, 7 phần bia sáng trong. Hình ảnh bia tươi với lớp bọt căng đầy mang đến cảm giác ngon miệng, sảng khoái, gợi lên vị êm đằm, cũng như hương hoa bia thơm dịu đặc trưng của bia tươi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Xuất Xứ: Việt Nam</p>\r\n\r\n<p>Dung Tích: 500ml</p>\r\n\r\n<p>Hạn Sử Dụng: 12 Tháng</p>',930000,5,9,'active',1,0,NULL,'2023-03-16 09:31:15','2023-04-04 10:20:04',NULL),(76,'CB2TBHNB-24L-330ML','combo-2-thung-bia-hanoi-bold-thung-24-lon-330ml','Combo 2 thùng Bia Hanoi BOLD – Thùng 24 lon 330ml','f3434aa2-c973-4169-bc69-5d3cab31b514','SẢN PHẨM CHỈ GIAO TẠI HÀ NỘI\n\nThông tin sản phẩm\n\n• Dung tích: 330ml/lon\n\n• Nồng độ cồn: 4.8 ± 0.4%\n\n• Thành phần: nước, malt, gạo, đường, hoa Houblon\n\n• HSD: 9 tháng kể từ ngày sản xuất\n\nThời gian phục vụ giao hàng\nTừ 03 – 08 ngày (trừ các ngày nghỉ lễ, tết theo quy định của Pháp luật). Thời gian giao hàng thực tế sẽ được nhân viên thông báo Quý khách khi xác nhận đơn hàng.','<p><strong>COMBO 2 TH&Ugrave;NG BIA HANOI BOLD &ndash; TH&Ugrave;NG 24 LON 330ML&nbsp;</strong></p>\n\n<p><strong>SẢN PHẨM CHỈ GIAO TẠI H&Agrave; NỘI</strong></p>\n\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\n\n<p>&bull; Dung t&iacute;ch: 330ml/lon</p>\n\n<p>&bull; Nồng độ cồn: 4.8 &plusmn; 0.4%</p>\n\n<p>&bull; Th&agrave;nh phần: nước, malt, gạo, đường, hoa Houblon</p>\n\n<p>&bull; HSD: 9 th&aacute;ng kể từ ng&agrave;y sản xuất</p>\n\n<p><strong>Hanoi BOLD&amp;Light: Đậm c&aacute; t&iacute;nh &ndash; Chuẩn chất men</strong></p>\n\n<p>Hanoi BOLD &amp; Hanoi Light l&agrave; cặp sản phẩm d&agrave;nh cho giới trẻ &ndash; thế hệ lu&ocirc;n hướng tới những trải nghiệm kh&aacute;c biệt v&agrave; đột ph&aacute;. Hanoi BOLD với chất men